import { FOOTS4 } from "../../images/images";
import servicesLogo from "../../images/img/services-logo.svg";
import { useEffect, useState } from "react";
import "./Catalog.css";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import img_1 from "./foto/1.png";
import img_2 from "./foto/2.png";
import img_3 from "./foto/3.png";
import img_4 from "./foto/4.png";
import img_5 from "./foto/5.png";
import img_6 from "./foto/6.png";

export const Catalog = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const [mainImage, setMainImage] = useState({ id: 1, src: img_1 });
  const [gender, setGender] = useState("woman");
  const [sliderRef, setSliderRef] = useState(null);
  const [smallImages, setSmallImages] = useState([
    { id: 2, src: img_2 },
    { id: 3, src: img_3 },
    { id: 4, src: img_4 },
    { id: 5, src: img_5 },
    { id: 6, src: img_6 },
  ]);

  const handleClick = (newImage) => {
    setMainImage(newImage);
  };

  const handleGenderClick = (newGender) => {
    setGender(newGender);
    if (newGender === "men") {
      sliderRef.slickGoTo(0);
    } else {
      sliderRef.slickGoTo(1);
    }
  };
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    swipeToSlide: true,
    afterChange: () => {
      setMainImage(smallImages[0]);
    },
  };

  console.log(gender);

  return (
    <>
      <section className="catalog">
        <div className="container">
          <div className="catalog__box">
            <div className="catalog__logo">
              <img src={servicesLogo} alt="" />
            </div>
            <h2 className="catalog__text">Каталог причесок</h2>
            <img className="catalog__foots" src={FOOTS4} alt="" />
          </div>

          {/* <div className="wrapper"> */}
          {/* <div className="page__title"> */}
          {/* <h1>Project</h1>
            </div>
            <div className="toggle__buttons">
              <button onClick={() => handleGenderClick("men")}>Мужчина</button>
              <button onClick={() => handleGenderClick("women")}>
                Женщина
              </button>
            </div> */}
          <div className="carousel__wrapper">
            <Slider ref={(slider) => setSliderRef(slider)} {...settings}>
              <div className="slider__image">
                <div className="slider__item__wrapper">
                  <div className="slider__content">
                    <div className="big__image">
                      <img
                        src={mainImage.src}
                        alt="Main"
                        style={{ width: "400px", height: "400px" }}
                      />
                    </div>
                    <div className="small__images">
                      {smallImages.map((image) => (
                        <img
                          key={image.id}
                          src={image.src}
                          alt="Small"
                          onClick={() => handleClick(image)}
                          style={{ width: "190px", height: "190px" }}
                        />
                      ))}
                    </div>
                  </div>
                  <div className="slider__texts">
                    <h1>Мужчинский блок</h1>
                    <p>1500тг</p>
                  </div>
                </div>
              </div>
              <div className="slider__image">
                <div className="slider__item__wrapper">
                  <div className="slider__content">
                    <div className="big__image">
                      <img
                        src={mainImage.src}
                        alt="Main"
                        style={{ width: "400px", height: "400px" }}
                      />
                    </div>
                    <div className="small__images">
                      {smallImages.map((image) => (
                        <img
                          key={image.id}
                          src={image.src}
                          alt="Small"
                          onClick={() => handleClick(image)}
                          style={{ width: "190px", height: "190px" }}
                        />
                      ))}
                    </div>
                  </div>
                  <div className="slider__texts">
                    <h1>Прическа тюльпан</h1>
                    <p>1500тг</p>
                  </div>
                </div>
              </div>
            </Slider>
          </div>
        </div>
        {/* </div> */}
      </section>
    </>
  );
};
